import React from 'react';
import computer from '../../images/computer.avif'

const styles = {
  grid: {
    margin: '25px',
  },
  image: {
    width: '30%',
  }
}

export default function Portfolio() {
  return (
    <div class="container" style={styles.gird}>
      <div class="row">
        <div class="col"><img style={styles.image} src={computer} alt='profile' /></div>
        <div class="col">Column</div>
        <div class="w-100"></div>
        <div class="col">Column</div>
        <div class="col">Column</div>
      </div>
    </div>

  );
}
